import React from 'react';
import styled, {css} from 'styled-components';
import ReactDOM from 'react-dom';
import './Header.css';

const header = `
	background: rgba(179, 182, 255, 0.41);
	position: absolute;
	width: 1440px;
	height: 100px;
`;

const Header = ({ children }) => {
  return (
    <header>
      <h1>{ children }</h1>
    </header>
  )
}

export default Header;
